import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Router, Switch, Route} from 'react-router-dom';

ReactDOM.render(
  <Router>
      <Switch>
          <Route path='/' component={App}/>
      </Switch>
  </Router>,
   document.getElementById('root')
  );
